INSERT INTO `news` (`id`, `text`, `date_news`, `admin_id`) VALUES
(1, 'حتى السنة القادمة ستبقى النصوص التعليمية الالكترونية قانونية الاستخدام والتعديل من أجل المحاضرات الجامعية. ممثلوا الجامعات وزارة التعليم ومنظمة حقوق النشر سيتفقوا على حل الى حين خريف السنة القادمة.\r\n\r\nوقال المتحدثون بأن الإتفاق ستلتزم به منظمة حقوق النشر حتى 31.09.2017 في العام المقبل، Thomas Grünewald، سكرتير في وزارة التعليم ولاية NRW.', '2022-03-22 03:37:35', 2),
(2, 'يجب أن لا يعود الطلاب الى فترة الطابعات الورقية.\r\n\r\nصراع بين الجامعات ومنظمة حقوق النشر، حول امكانية استخدام النصوص التعليمية الرقمية او الإلكترونية. حتى خريف السنة القادمة سيسمح للطلاب استخدامها. ولحين ذلك الوقت يجب ان يوجد حل للمشكلة.', '2022-03-22 03:38:30', 2),
(3, 'منظمة حقوق النشر و وزير الثقافة اتفقا على فاتورة واحدة، لكل طالب يجب أن يدفع 0,008 سنت لكل صفحة الكترونية ولكل فصل  لمنظمة حقوق النشر. وقد وجدت الجامعات هذا الأتفاق معقداً جداً – مع النتيجة أن الطلاب عليهم ان يعودوا الى الصفحات الورقية والطباعة ابتداءاً من شهر يناير.', '2022-03-22 03:39:23', 4),
(4, 'لهاذا السبب أطلق طالبان من جامعة ميونخ عريضة الكترونية بعنوان “اوقفوا نقل الجامعات الى عصر ما قبل الرقمية”. وقد كتبا أيضاً: اذا لم يتبقى هناك اوراق ونصوص الكترونية، فلن يكون هذا “فقط تراجعاً و نكسة للطلاب، بل أيضاً نكسة للمكانة العلمية لألمانيا”.', '2022-03-22 03:39:39', 4),
(5, 'لقد وضعوا مسبقاً هدفاً 50.000 توقيع. اليوم الجمعة وصل العدد الى 85.000 توقيع. الان يريدان  Golde  و Hildebrandt المزيد. الهدف القادم هو 150.000 توقيع. بالتوازي مع ذلك قام عدد من الجامعات وممثلي الطلبة بارسال اوراق رسمية لوزاة التعليم، يرثون بها اعادة الجامعات عشرات السنين الى الوراء.', '2022-03-22 03:39:56', 4),
(6, 'قيع. الان يريدان Golde و Hildebrandt المزيد. الهدف القادم هو 150.000 توقيع. بالتوازي مع ذلك قام عدد من الجامعات وممثلي الطلبة بارسال اوراق رسمية لوزاة التعليم، يرثون بها اعادة الجامعات عشرات السنين الى الوراء.', '2022-03-22 04:21:08', 4);

